import navigation from '../images/navigation.png'

let navMenuContainer = {
    width: 100,
    height: 30,
    backgroundColor: "#063b50",
    borderRadius: '5px 0 0 0',
    marginRight: 2,
    cursor: 'pointer',
}

let navImg = {
    display: 'flex',
    margin: 'auto',
    paddingTop: 6,
    width: 18
}

export default function NavMenu() {
    return (
        <div style={navMenuContainer}>
            <img style={navImg} src={navigation} alt=''/>
        </div>
    )
}
